INSERT INTO `chapter` (`chID`, `chNumber`, `chSerial`, `chName`, `chView`, `sID`, `content`, `wordNumber`, `createDate`, `uID`, `price`, `dealine`, `chStatus`) VALUES
(1, '1', 1, 'Hoàng Sơn Chân Quân cùng Cửu Châu nhất hào quần', 23, 1, 'Năm 2019 ngày 20 tháng 5, ngày thứ Hai.\r\n\r\nXuân tẫn hạ chí.\r\n\r\nMùa này, Giang Nam khu ngày đêm nhiệt độ chênh lệch vô cùng lớn. Ban ngày còn mặc quần cộc nóng thành chó; ban đêm lại đến núp ở trong chăn đông lạnh thành Hàn hào điểu.\r\n\r\nGiang Nam Đại Học Thành.\r\n\r\nHai giờ mười ba phút chiều, cái giờ này chính là các học sinh giờ đi học. Tống Thư Hàng lại một mình ở tại ký túc xá, bàn máy tính bị kéo đến bên giường, thuận tiện hắn dùng các loại tư thế quan sát phim.\r\n\r\nTống Thư Hàng cũng không có trốn học yêu thích —— buổi tối hôm qua nửa đêm thời tiết oi bức, trong lúc ngủ mơ hắn sử xuất một chiêu \'Song Long Xuất Hải\' đạp bay chăn. Nửa đêm về sáng, nhiệt độ không khí kịch hàng. Toàn thân trên dưới chỉ có một đầu quần cộc Tống Thư Hàng lập tức khổ bức, trong lúc ngủ mơ hai tay của hắn trên giường đau khổ tìm tòi, tìm kiếm thăm dò, lại sờ không tới chăn. Cuối cùng chỉ có co lại thành Bì Bì tôm hình, tại nửa đêm hàn phong dưới dâm uy run lẩy bẩy.\r\n\r\nMặt trời mới mọc dâng lên lúc, Tống Thư Hàng đã trở thành mùa cảm mạo đại quân một viên.\r\n\r\nBạn cùng phòng đã thay hắn xin nghỉ hôm nay khóa.\r\n\r\nSau đó, hắn uống thuốc cảm, ngủ một giấc đến bây giờ.\r\n\r\nSốt cao rút đi, thân thể vẫn còn có chút suy yếu, dạng này trạng thái căn bản là không có cách đi học. Cho nên, hắn chỉ có thể một thân một mình ở tại ký túc xá nhàm chán xem phim.\r\n\r\nTrên màn hình, phim phát ra thanh tiến độ chậm rãi tiến lên. Nhưng phim nội dung, Tống Thư Hàng lại một chút cũng không thấy đi vào.\r\n\r\n\"Dược hiệu còn không có đi qua à, buồn ngủ quá.\" Hắn ngáp một cái, cảm giác mí mắt có chút nặng nề.\r\n\r\n\'Tích tích tích ~\' lúc này, máy tính dưới góc phải phần mềm chat nhảy lên.\r\n\r\nĐây là có người đem hắn thêm làm hảo hữu, hoặc là gia nhập quần tổ nhắc nhở.\r\n\r\n\"Ai thêm ta?\" Tống Thư Hàng lẩm bẩm nói, hắn đưa tay tại máy tính cảm ứng dưới góc phải nhẹ nhàng điểm một cái, nhắc nhở tin tức bắn ra.\r\n\r\n[ Hoàng Sơn Chân Quân (******) thỉnh cầu tăng thêm ngươi làm hảo hữu. ] kèm theo tin tức: Không.\r\n\r\nHoàng Sơn Chân Quân? Ai vậy, loại này kỳ quái biệt danh?\r\n\r\n\"Là trong lớp đồng học sao?\" Tống Thư Hàng thầm nghĩ, trong đầu không khỏi nhớ tới trong lớp mấy cái kia rõ ràng đã lên đại học vẫn còn ở vào thanh xuân huyễn tưởng kỳ gia hỏa. Nếu như là bọn hắn mà nói, hoàn toàn chính xác hội lên loại này kỳ quái biệt danh.\r\n\r\nNghĩ tới đây, hắn điểm \'Đồng ý\' .\r\n\r\nNgay sau đó, lại có một đầu hệ thống tin tức bắn ra.\r\n\r\n[ Hoàng Sơn Chân Quân mời ngươi gia nhập quần \'Cửu Châu nhất hào quần \', có đồng ý hay không? ]\r\n\r\nTống Thư Hàng tiếp tục ấn đồng ý.\r\n\r\n\'Thư Sơn Áp Lực Đại\' đồng ý gia nhập \'Cửu Châu nhất hào quần\' .\r\n\r\n[ ngài đã đồng ý gia nhập quần tổ, cùng nhóm quần hữu chào hỏi đi! ] còn tặng kèm có cái hệ thống khuôn mặt tươi cười.\r\n\r\nĐầu năm nay Chat Messenger làm càng ngày càng nhân tính hóa.\r\n\r\nLiên tiếp nhắc nhở bắn ra phía sau Tống Thư Hàng đàm định tắt đi nhắc nhở cùng quần khung chít chát —— hắn hiện tại buồn ngủ dâng lên, nào có tinh lực quan tâm chính mình tăng thêm cái gì quần?\r\n\r\nDù sao, hắn quần thiết trí một mực là \'Không gợi ý tin tức chỉ biểu hiện số lượng \', quần bên trong nói chuyện phiếm sẽ không bắn ra quấy rầy đến hắn, sẽ chỉ ở quần tổ sau biểu hiện nói chuyện phiếm số lượng.\r\n\r\nChờ hắn thanh tỉnh chút phía sau có thể đi lật qua nói chuyện phiếm ghi chép, liền có thể biết mình gia nhập là cái gì quần, còn có quần bên trong thành viên nói chuyện phiếm ghi chép cũng sẽ không mất đi.\r\n\r\nCon mắt càng ngày càng nặng nề. . .\r\n\r\nPhim thanh tiến độ vẫn như cũ ngoan cường tiến lên, Tống Thư Hàng ý thức lại càng thêm mơ hồ.\r\n\r\n**** ******\r\n\r\nCửu Châu nhất hào quần bên trong, nhìn thấy có tân nhân gia nhập phía sau quần bên trong có lặn xuống nước thành viên ngoi đầu lên.\r\n\r\nBắc Hà Tán nhân: \"Hoàng Sơn Chân Quân tăng thêm vị tân đạo hữu đi vào sao? Đã có hơn một năm không có thêm người mới a?\"\r\n]\r\n\r\n\r\nLại có id vì \'Tô thị A Thất\' cấp tốc hồi phục: \"Có tân đạo hữu? Đạo hữu là Hoa Hạ cái nào khu? Ở đâu cái động phủ tu hành? Đạo hiệu đâu? Tu vi mấy phẩm?\"\r\n\r\nCái này liên tiếp vấn đề, luôn cảm giác có chỗ nào không thích hợp?\r\n\r\nGần như đồng thời, id vì Cuồng Đao Tam Lãng bắn ra tin tức: \"Tân đạo hữu giới tính? Có phải là tiên tử không? Là thì báo ba vòng, bày ra cái ảnh thôi!\"\r\n\r\nNhìn thấy Tô thị A Thất cùng Cuồng Đao Tam Lãng tin tức, quần bên trong có mấy người khóe miệng co giật.\r\n\r\n\"Tam Lãng huynh, ngươi quả nhiên là thuộc cá vàng sao?\" Bắc Hà Tán nhân thở dài: \"Ngươi cũng đừng lại tác tử, vạn nhất Hoàng Sơn Chân Quân lại tăng thêm vị Đại tiền bối tiến đến làm sao bây giờ?\"\r\n\r\nTam Lãng cái này gia hỏa cái gì cũng tốt, có tình có nghĩa, lấy giúp người làm niềm vui, cho nên nhân duyên không tệ —— chính là bình thường ưa thích miệng ba hoa, tác một tay hảo tử.\r\n\r\nHết lần này tới lần khác cái này gia hỏa may mắn giá trị lại thấp để cho người ta giận sôi, mỗi lần không cấm ý ở giữa tác tử lúc, đắc tội tổng là Đại tiền bối. Những này nhàn rỗi nhức cả trứng Đại tiền bối đang lo không có việc vui, tự nhiên rất vui vẻ giày vò lên Cuồng Đao Tam Lãng cái này đưa tới cửa việc vui.\r\n\r\n\"Quỳ cầu không cần xách \'Đại tiền bối\' mấy chữ, bản tọa trong lòng có bóng tối.\" Cuồng Đao Tam Lãng phát một loạt \'Lệ rơi đầy mặt\' biểu lộ.\r\n\r\nBốn năm trước hắn trương này phá miệng đắc tội một vị xinh đẹp \'Đại tiền bối \', bị giày vò thảm rồi. . . Cái kia Đại tiền bối liên tiếp giày vò hắn ròng rã một năm lẻ bốn tháng. Ngài không nghe lầm, là ròng rã một năm lẻ bốn tháng a! Nhớ tới cái kia đoạn không phải người tranh vanh tuế nguyệt, hốc mắt của hắn đều ẩm ướt.\r\n\r\nTam Lãng mới lời này vừa mới nói xong, quần bên trong liền liên tiếp bắn ra cười xấu xa biểu lộ —— không che giấu chút nào, ngay thẳng cười trên nỗi đau của người khác.\r\n\r\nQuần bên trong biểu hiện tại tuyến trạng thái có tám người, trong đó có sáu người cùng nhau bắn ra quét một loạt khuôn mặt tươi cười.\r\n\r\n\"Các ngươi bọn này cười trên nỗi đau của người khác gia hỏa, bản tọa nhớ kỹ các ngươi mỗi người, đừng cho bản tọa gặp gỡ các ngươi, nếu không nhất định phải làm cho các ngươi nếm thử bản tọa bảy mươi hai đường khoái đao lợi hại!\" Cuồng Đao Tam Lãng oán hận nói. Hắn đối với mình khoái đao rất có tự tin, vừa rồi cười xấu xa sáu cái gia hỏa, đơn đấu lời nói không có một cái nào là đối thủ của hắn.\r\n\r\nCuồng Đao Tam Lãng vừa mới nói xong.\r\n\r\nQuần bên trong lập tức lại đánh lên một cái cười xấu xa biểu lộ, là Tô thị A Thất.\r\n\r\nTiếp lấy Tô thị A Thất rất hưng phấn nói: \"Lúc nào đơn đấu?\"\r\n\r\nHiển nhiên, Tô thị A Thất cũng không có cười trên nỗi đau của người khác ý tứ —— hắn chính là muốn tìm người đánh một trận.\r\n\r\n\". . .\" Cuồng Đao Tam Lãng lập tức suy sụp.\r\n\r\nBởi vì hắn đánh không lại A Thất!\r\n\r\nHắn tu vi tinh thâm, đã đạt tới Ngũ phẩm Linh Hoàng hậu kỳ cảnh giới, cách Lục phẩm Linh Quân cũng chỉ có hai bước khoảng cách, nhưng là hắn đánh không lại A Thất.\r\n\r\nHắn một tay bảy mươi hai đường đao pháp vừa nhanh vừa độc, còn có nhanh như thiểm điện thân pháp, nhưng là đánh không lại A Thất.\r\n\r\nHắn danh xưng Cuồng Đao, cuồng lúc ngay cả mình đều sợ, nhưng chính là đánh không lại A Thất!\r\n\r\nQuần bên trong người nhìn thấy Tam Lãng suy sụp phía sau lại là một chuỗi không chút kiêng kỵ khuôn mặt tươi cười.\r\n\r\n\". . .\" Lần này, Cuồng Đao Tam Lãng chỉ có thể buồn bực phát một chuỗi dấu hai chấm.\r\n\r\nQuần bên trong người nháo đằng nửa ngày, lại không nhìn thấy tân nhân lên tiếng, hơi nghi hoặc một chút.\r\n\r\n\"Tân đạo hữu không ra?\" Bắc Hà Tán nhân lên tiếng hỏi.\r\n\r\nĐáng tiếc, bởi vì thuốc cảm mạo dược hiệu, Tống Thư Hàng đã lần nữa tiến vào nửa ngủ trạng thái.\r\n\r\nLúc này, Tô thị A Thất lại rất vui vẻ phát cái tin: \"Ta xem dưới, tân đạo hữu gọi \'Thư Sơn Áp Lực Đại\' . Có nghe qua gọi cái này đạo hiệu cao thủ sao? Cái này đạo hiệu nghe có chút giống như là Nho môn hành giả? Thật làm cho người chờ mong a! Những năm này, Nho môn hành giả ẩn cư vô cùng sâu, tìm cũng không tìm tới. Ta đã có gần trăm năm không có đánh qua bọn hắn! Hồi tưởng lại, Nho môn hành giả so Phật môn còn muốn đánh thoải mái, không chỉ có mồm mép lợi hại, nắm đấm cũng đủ cứng. Mà lại đánh tới hào hứng lúc sẽ còn phóng khoáng ngâm Thi trợ hứng, lần thoải mái! Thích nhất đánh bọn hắn.\"\r\n\r\n\"A Thất, ta nói, ngươi đối tân đạo hữu chờ mong vĩnh viễn chỉ có có được hay không đánh, cùng đánh sướng hay không? Sao?\" Cuồng Đao Tam Lãng phát cái lệ rơi đầy mặt biểu lộ nói. Đây quả thực là ác bá hành vi có được hay không? !\r\n\r\n\"Ây.\" Tô thị A Thất có chút xấu hổ.\r\n\r\nBắc Hà Tán nhân cười xấu xa nói: \"Có thể hay không lại là cái sẽ không dùng Chat Messenger \'Đại tiền bối\' ?\"\r\n\r\nHắn vừa nói như thế, tất cả mọi người cảm giác tràng diện này rất có tức thị cảm đâu?\r\n\r\nĐúng a, không sai biệt lắm bốn năm trước tựa hồ cũng có một vị bế quan mấy trăm năm sau xuất quan tiền bối , đồng dạng thật vất vả lên phần mềm chat, bị Hoàng Sơn Chân Quân gia nhập quần. Nhưng bởi vì sẽ không đánh chữ, không có phát biểu.\r\n\r\nSau đó, một vị gọi Cuồng Đao Tam Lãng gia hỏa rất vui vẻ tại vị này tiền bối trước mặt miệng ba hoa, lại phải vị tiền bối này báo ba vòng, lại phải nàng phát ảnh chụp, lại phải giọng nói nói chuyện phiếm cái gì. \r\n\r\nSau đó. . . Không có qua mấy ngày, Cuồng Đao Tam Lãng liền tận mắt thấy vị tiền bối này. Đó là vị rất đẹp tiền bối, như là trong bầu trời đêm minh nguyệt đồng dạng loá mắt mỹ lệ.\r\n\r\nLại nói tiếp, vị này mỹ lệ tiền bối giày vò Cuồng Đao Tam Lãng ròng rã một năm lẻ bốn tháng, mới hài lòng rời đi.\r\n\r\nCuồng Đao Tam Lãng lập tức quỳ.\r\n\r\n\"Hoàng Sơn?\" Lúc này, một cái gọi \'Dược Sư\' id phát biểu.\r\n\r\nKhông hiểu thấu ngắn gọn tin tức, không đầu không đuôi.\r\n\r\nCũng may quần bên trong người sớm quen thuộc Dược Sư ngắn gọn nói chuyện phiếm thói quen —— hắn là đang hỏi quần chủ Hoàng Sơn Chân Quân người ở đâu?\r\n\r\nPhát biểu ngắn gọn cũng không phải là Dược Sư tính cách cao quý lãnh ngạo, mà bởi vì hắn đánh chữ dùng chính là hai chỉ thiền cộng viết tay, tốc độ tặc chậm. Số lượng từ nhiều thời điểm còn dễ dàng sai, xóa xóa viết viết vô cùng thống khổ. Cho nên Dược Sư thói quen phát biểu có thể ngắn thì ngắn. Dần dà, liền biến thành bây giờ loại này tích chữ như vàng giao lưu phương thức.\r\n\r\n\"Hắn tăng thêm người sau liền lập tức logout, nghe nói hắn nhà cái kia bảo bối Đại yêu khuyển lại bị tức giận rời nhà đi ra ngoài, Hoàng Sơn Chân Quân lại đuổi theo. Ứng phó cái kia bảo bối Đại yêu khuyển cũng không dễ dàng, hiện tại Chân Quân khẳng định rất bận rộn, có thể lên tuyến cộng người đều là khó được dành thời gian.\" Bắc Hà Tán nhân trả lời.\r\n\r\n\". . .\" Dược Sư.\r\n\r\n\"Vậy chỉ có thể chờ tân đạo hữu học được dùng Chat Messenger sau lại hàn huyên.\" Tô thị A Thất cảm thán nói. Bọn hắn đều vào trước là chủ, cho rằng mới gia nhập cũng là người trong đồng đạo.\r\n\r\nGặp tân đạo hữu không có phản ứng, tại tuyến mấy vị gặp không có việc vui, cũng đều nhao nhao lặn xuống nước.\r\n\r\n**** ******\r\n\r\nƯớc chừng sau một tiếng, Tống Thư Hàng thoáng tỉnh táo lại.\r\n\r\n\"Nhớ kỹ vừa rồi có người cộng ta quần đi, giống như gọi Cửu Châu nhất hào quần đến?\" Hắn thấp giọng thì thào, tiện tay ấn mở dưới góc phải Chat Messenger, lôi ra Cửu Châu nhất hào quần khung chít chát.\r\n\r\nĐến cùng là cái gì quần?\r\n\r\nRất nhanh, một giờ trước nói chuyện phiếm ghi chép xuất hiện ở trước mặt hắn.\r\n\r\nTống Thư Hàng đại khái du lãm một lần.\r\n\r\nĐạo hữu? Động phủ? Tu vi mấy phẩm?\r\n\r\nCòn có tiền bối? Chân Quân? Bản tọa? Đuổi bắt Đại yêu khuyển?\r\n\r\nCác loại tiên hiệp trong tiểu thuyết chuyên dụng từ ngữ.\r\n\r\nQuần bên trong nhân viên nói chuyện phiếm phương thức nói chuyện cũng rất thú vị —— nửa cổ không cổ, nửa Bạch không Bạch. Cho người cảm giác chính là người hiện đại ý đồ dùng cổ ngữ giao lưu, hết lần này tới lần khác lại bởi vì cổ văn bản lĩnh thất bại, dẫn đến giao lưu phương thức rất khó chịu.\r\n\r\n\"Xoẹt ~~\" Tống Thư Hàng cười ra tiếng.\r\n\r\nXem ra đó là cái tiên hiệp kẻ yêu thích xây quần?\r\n\r\nA không, đây tuyệt đối không phải phổ thông tiên hiệp kẻ yêu thích quần!\r\n\r\nQuần bên trong mỗi người đều cho mình lên cái đạo hiệu, chỗ ở muốn xưng động phủ, quần chủ lạc đường chó cảnh đều muốn hình dung thành gia bên trong Đại yêu khuyển rời nhà trốn đi. Còn có người tự xưng trên trăm năm không có đánh qua Nho môn hành giả cái gì, nói cách khác người kia tự xưng đã sống hơn mấy trăm tuổi?\r\n\r\nChỉ là nhìn lấy những này nói chuyện phiếm ghi chép thì có loại thật xấu hổ cảm giác.\r\n\r\n\"Loại này si mê trình độ, đã đạt đến chuunibyou trình độ đi, mà lại là rất có Hoa Hạ đặc sắc tiên hiệp tự kỷ.\" Tống Thư Hàng âm thầm gật đầu.\r\n\r\nXem ra, đó là cái tiên hiệp chuunibyou người bệnh trại tập trung!\r\n\r\nĐây cũng là hắn đối \'Cửu Châu nhất hào quần\' cùng quần bên trong thành viên ấn tượng đầu tiên.\r\n\r\nBất quá vì sao lại cộng hắn nhập quần?\r\n\r\nHắn nhìn xuống quần chủ Hoàng Sơn Chân Quân tư liệu, cũng không phải là bạn học của mình, bản thân cũng khẳng định không biết hắn.\r\n\r\nLà lầm thêm sao?', 2933, '2018-09-10 22:52:08', 1, 0, NULL, 1),
(2, '1', 1, 'Hắn gọi Bạch Tiểu Thuần', 25, 2, 'Nhưng mà sự thật chính là như thế.<br/><br/>Trần Tường nói.<br><br>\"Chắc hẳn ngươi hẳn là, cũng đã đi phái người điều tra cái này tên là 《 Tây Du chiến kỷ 》 trò chơi a? Nhưng là bất kể là đưa vào hoạt động trò chơi này \"Thần thoại\" công ty, cùng cái công ty này lão bản , mặc kệ tin tức cũng không tra ra.\"<br><br>Trần Tường tiếp tục nói. <br><br>\"Không sai, đúng là như thế.\"<br><br>Lão nhân nghĩ đến mệnh lệnh mình bí thư đi thăm dò tin tức, gật đầu nói.<br><br>\"Nói thực ra, ta cũng không biết, ta thậm chí hoài nghi cái này 《 Tây Du chiến kỷ 》 là thần linh hoặc là ác ma vận doanh một trò chơi, bất kể thế nào nói, trò chơi này xuất hiện, đều cho nhân loại trong tương lai cái nguy cơ đó nặng nề thế giới, một tia sống tiếp cơ hội \"<br><br>Trần Tường nói.<br><br>\"Người tuổi trẻ kia, theo ý kiến của ngươi, Trung Hoa nên như thế nào né qua kiếp nạn này?\"<br><br>Sau đó lão nhân như có điều suy nghĩ.<br><br>\"Chính phủ tuyên truyền, toàn dân tiến vào trò chơi, nhất là quân đội.\"<br><br>Trần Tường bình tĩnh nói.<br><br>\"Người trẻ tuổi, của ngươi đó thân thực lực, là từ trong trò chơi lấy được sao?\"<br><br>Sau đó lão nhân hỏi.<br><br>\"Đúng thế.\"<br><br>Cái này không có gì đáng giá giấu giếm, Trần Tường gật đầu nói.<br><br>\"Tốt, ta hiểu được, một vấn đề cuối cùng, người trẻ tuổi, ngươi lại là làm sao biết, tương lai địa cầu trận kia kiếp nạn đâu?\"<br><br>Lão nhân cầm trong lòng mình, nghi ngờ nhất một vấn đề hỏi lên.<br><br>\"Ngươi có thể hiểu thành, ta cơ duyên xảo hợp đăng nhập vào trò chơi, sau đó thu được một cái biết trước tương lai năng lực, trước giờ biết trước được tương lai trận kia đại kiếp tồn tại.\"<br><br>Trần Tường bình tĩnh nói.<br><br>\"Người trẻ tuổi, ngươi nguyện ý làm Trung Hoa tướng quân sao?\"<br><br>Lão nhân bất thình lình hỏi.<br><br>\"Không có hứng thú.\"<br><br>Nghe được ý của ông lão, Trần Tường không hề nghĩ ngợi, chỉ lắc đầu cự tuyệt.<br><br>Tại thế giới trò chơi bên trong, hắn đã là một phương đại đế, đối với quyền thế các loại đồ vật , có thể nói hắn hoàn toàn không chút nào tham luyến.<br><br>Với lại thế giới trò chơi mới là trọng yếu nhất, thế giới trò chơi thực lực đề cao, thế giới hiện thật thực lực mới có thể tương ứng nước lên thì thuyền lên.<br><br>Hắn cũng không muốn trở thành tướng quân, tiếp những cái kia lão đại chơi cái gì quyền lợi chính trị trò chơi.<br> <br>Đó hoàn toàn là đang lãng phí thời gian.<br><br>\"Chuyện này là ngươi đến, không có ngươi chỉ sợ không được, nếu như ngươi sợ phiền toái, ta có thể cho ngươi một cái nhàn chức.\"<br><br>Sau đó lão nhân nói.<br><br>Hắn biết rõ thế hệ này lớn lên người trẻ tuổi, cũng không phải là mỗi một cái, đều cam nguyện vì quốc gia vô tư dâng hiến.<br><br>Trần Tường vốn đang là muốn cự tuyệt, nhưng nhìn đến già người trên trán nếp nhăn, cùng cái kia tha thiết ánh mắt, không biết vì sao, hắn trong lúc nhất thời mềm lòng.<br><br>\"Tốt, ta có thể tiếp thụ, nhưng trước giờ nói xong, chỉ là trên danh nghĩa, ta không quản sự.\"<br><br>Trần Tường cuối cùng nói.<br><br>\"Liền xem như trên danh nghĩa cũng tốt, Trần Tường, ngươi đón lấy chính là Trung Hoa Trung tướng, chức vụ là 749 cục danh dự Cục Trưởng.\"<br><br>Xem Trần Tường không có tiếp tục cự tuyệt, lão nhân cảm thấy hết sức vui mừng.<br><br>\"749 cục?\"<br><br>Trần Tường nghi ngờ nói.<br><br>\"Đây là quốc gia chúng ta, ở trên thế kỷ thành lập một cái, người nghiên cứu thể khoa học, hiện tượng linh dị, đặc dị công năng bí mật quân đội, bởi vì cục thế cùng thời đại nguyên nhân, luôn luôn không chịu đến quốc gia coi trọng, nhưng là bây giờ những quái vật kia xuất hiện, xem ra là thời điểm bắt đầu dùng 749 cục.\"<br><br>Sau đó lão nhân giới thiệu nói.<br><br>\"Quân phục cùng Quân Quan Chứng, ngày mai liền sẽ có người đưa tới nếu như 749 cục công tác cần tiểu bằng hữu chỉ đạo, kính xin tiểu bằng hữu ngươi phải nhiều hơn hao tâm tổn trí.\"<br><br>Sau đó tới người đứng lên nói.<br><br>\"Được rồi.\"<br><br>Trần Tường đáp ứng.<br><br>\"Đây là thư ký của ta Quách Phong, nếu như có chuyện ta về thông qua hắn liên hệ ngươi.\"<br><br>Sau đó trước lúc rời đi, lão nhân chắp tay nói.\"Không có vấn đề.\"<br><br>Trần Tường gật đầu.<br><br>Cái này Quách Phong tại lưu lại Trần Tường phương thức liên lạc về sau, liền cùng lão nhân cùng rời đi.<br><br>\"Ca ca, ngươi thành tướng quân a!\"<br><br>Chờ lão nhân sau khi rời đi, Trần Hải Nhi tỉnh táo lại, gương mặt kinh hỉ nói.<br><br>Đây là nàng ít có xưng hô Trần Tường vì ca ca.<br><br>\"Một tên tướng quân có gì đáng giá cao hứng.\" Ai biết Trần Tường, trên mặt một điểm cao thần sắc đều không có, giống như chuyện gì đều không phát sinh một dạng.<br><br>\"Đây chính là tướng quân à! Mà lại là trung tướng, ngươi chỉ sợ là Trung Hoa trong lịch sử, tuổi trẻ nhỏ nhất Trung tướng đi.\"<br> <br>Trần Hải Nhi gương mặt cao hứng nói.<br><br>\"Vậy thì thế nào?\" Trần Tường hỏi lại Trần Hải Nhi.<br><br>Trần Tường hỏi lại , lệnh Trần Hải Nhi thần sắc đọng lại.<br><br>. . . .<br><br>Đây chính là Trung Hoa trung tướng à!<br><br>Trung tướng thân phận, tại toàn bộ Trung Hoa chỉ sợ đều xem như một vị đại lão a?<br><br>Trần Tường này làm sao nói cũng coi là quang tông diệu tổ a?<br><br>Kết quả Trần Tường à nha?<br><br>Thần sắc này thậm chí còn không bằng, chính mình trong đại học những bạn học kia, được tuyển cán bộ lớp cao hứng.<br><br>Trần Hải Nhi lúc này mới cảm thấy, chính mình không có chút nào hiểu rõ chính mình cái này ca ca.<br><br>\"Nhớ kỹ ta nói với ngươi, có thời gian chơi nhiều chơi 《 Tây Du chiến kỷ 》 trò chơi này, khả năng này sẽ trở thành ngươi tương lai sống sót tiền vốn.\"<br><br>Trần Tường dặn dò một tiếng Trần Hải Nhi về sau, sau đó liền về tới gian phòng của mình.<br><br>Hôm nay là 《 Tây Du chiến kỷ 》 đổi mới ngày ba ngày sau, 《 Tây Du chiến kỷ 》 đổi mới về sau, sẽ tại buổi tối hôm nay rạng sáng 12 giờ tiếp tục mở phục tùng.<br><br>. . . .<br><br>Xem ca ca của mình cùng lão nhân nói chuyện nội dung, không giống như là đùa giỡn.<br><br>Trần Hải Nhi đã quyết tâm , đợi lát nữa liền đi chơi dưới cái này tên là 《 Tây Du chiến kỷ 》 trò chơi.<br><br>Trần Tường nhưng lại không biết.<br><br>Lão nhân tại rời đi trụ sở của hắn về sau, liền trực tiếp ngồi máy bay riêng bay trở về Yến Kinh.<br><br>Sau đó có quan hệ như thế nào quảng bá 《 Tây Du chiến kỷ 》 trò chơi này mệnh lệnh, bị quốc gia trao quyền cho cấp dưới đến Trung Hoa cả nước các thành phố lớn, thậm chí huyện trấn chính phủ.<br><br>Sau đó Trung Hoa các thành phố lớn cao ốc, tàu điện ngầm, cửa hàng nhấp nhô bài bên trên, khắp nơi tất cả đều là có quan hệ 《 Tây Du chiến kỷ 》 trò chơi quảng bá.<br><br>Tại dạng này quảng bá cường độ dưới, liền xem như chất lượng kém đi nữa trò chơi, đều sẽ có như vậy một nắm người chơi cùng sinh ra mãnh liệt lòng hiếu kỳ, muốn đi vào thử một lần.<br><br>Huống chi 《 Tây Du chiến kỷ 》 trò chơi này chất lượng, là quốc tế đứng đầu.<br><br>Cho nên đối với 《 Tây Du chiến kỷ 》 trò chơi này, sinh ra hứng thú người chơi, càng nhiều.<br><br>Bọn hắn đều ở đây mình trí năng đồng hồ bên trên, lắp xong 《 Tây Du chiến kỷ 》 khách hàng, chỉ còn chờ rạng sáng 12 giờ, liền tiến vào trong trò chơi.<br><br>Mặt khác, hôm nay nước Hoa quân đội. Cũng tất cả đều nhận được một cái đặc biệt nhiệm vụ.<br><br>Cái kia chính là toàn quân download, một cái tên là 《 Tây Du chiến kỷ 》 trò chơi khách hàng, toàn quân tổ đội chơi đùa. Quân lệnh này vừa đưa ra, không biết kinh sợ đã hỏng bao nhiêu quân nhân cùng quân đội Sĩ Quan. <p>&nbsp;</p><p>Main hay, lão quái vật thích giấu nghề, pet vô sỉ. ', 0, '2018-09-10 22:52:09', 1, 10, '2018-11-23 01:03:30', 1),
