(1, 'Tu Chân Nói Chuyện Phiếm Quần', '修真聊天群', 'http://www.qidian.com/Book/3602691.aspx', 'https://res.cloudinary.com/thang1988/image/upload/v1539535310/truyenmvc/tu-chan-noi-chuyen-phiem-quan.jpg', 'Thánh kỵ sĩ truyền thuyết', 'Một ngày, Tống Thư Hàng ngoài ý muốn gia nhập một cái tiên hiệp chuunibyou thâm niên người bệnh giao lưu quần, bên trong quần bạn nhóm đều lấy \'Đạo hữu\' tương xứng, quần danh thiếp đều là các loại Phủ chủ, Động chủ, Chân nhân, Thiên Sư. Liền chủ nhóm lạc đường chó cảnh đều xưng là Đại yêu khuyển rời nhà trốn đi. Cả ngày nói chuyện là luyện đan, xông bí cảnh, luyện công kinh nghiệm cái gì.\r\n\r\nĐột nhiên có một ngày, lặn xuống nước hồi lâu hắn đột nhiên phát hiện... Trong đám mỗi một cái quần viên, vậy mà toàn bộ là Tu chân giả, có thể di sơn đảo hải, trường sinh ngàn năm cái chủng loại kia!', 23, 9, 1, '2018-09-01 22:48:35', NULL, 100, 30, 1, '2018-09-10 22:48:35', 1),
(2, 'Nhất Niệm Vĩnh Hằng', '一念永恒', 'http://www.qidian.com/Book/1003354631.aspx', 'https://res.cloudinary.com/thang1988/image/upload/v1539535551/truyenmvc/nhat-niem-vinh-hang.jpg', 'Nhĩ Căn', 'Nhất niệm thành thương hải , nhất niệm hóa tang điền . nhất niệm trảm thiên ma , nhất niệm tru vạn tiên . duy ngã niệm …… vĩnh hằng', 83, 8, 1, '2018-09-10 22:49:46', NULL, 120, 15, 1, '2018-11-07 22:30:00', 2),
(3, 'Dị Thế Giới Mỹ Thực Gia', '异世界的美食家', 'https://www.lread.net/read/51823/', 'https://res.cloudinary.com/thang1988/image/upload/v1539535665/truyenmvc/di-the-gioi-my-thuc-gia.jpg', 'Lý Hồng Thiên', 'Ở Vũ Giả nhấc tay có thể Liệt Sơn xuyên, súy chân có thể đoạn trường hà Huyền Huyễn trên thế giới, tồn tại như vậy một nhà nhà hàng nhỏ . \r\n\r\nNhà hàng nhỏ không lớn, nhưng là vô số cường giả đỉnh cao xua như xua vịt chi địa . \r\n\r\nỞ đàng kia ngươi có thể thưởng thức được dùng trứng Phượng Hoàng cùng Long Huyết mét xào thành cơm xào trứng . \r\n\r\nỞ đàng kia ngươi có thể Hát đáo Sinh Mệnh Chi Tuyền xứng Chu Quả chế riêng Liệt Tửu . \r\n\r\nỞ đàng kia ngươi có thể ăn được Cửu Giai Thánh Thú nhục thân hợp với Hắc hồ tiêu thịt quay . \r\n\r\nCái gì ngươi nghĩ đem đầu bếp bắt về nhà ? Không có khả năng, bởi vì nhà hàng cửa nằm một con giữ cửa Thập Giai Thần Thú, Địa Ngục Khuyển . \r\n\r\nOh, người đầu bếp còn có một cái có thể một tay bóp chết Cửu Phẩm Chí Tôn cục sắt trợ thủ cùng một đám bị chinh phục dạ dày điên cuồng nữ nhân . ', 0, 10, 1, '2018-09-10 22:49:46', NULL, 125, 40, 1, '2018-09-10 22:49:47', 1),
(4, 'Mục Thần Ký', '牧神记', 'https://book.qidian.com/info/1009704712', 'https://res.cloudinary.com/thang1988/image/upload/v1539535810/truyenmvc/muc-than-ky.jpg', 'Trạch Trư', 'Đại khư tổ huấn nói, trời tối, đừng đi ra ngoài.\r\n\r\nĐại khư tàn lão thôn già yếu tàn tật bọn họ từ bờ sông nhặt được một đứa bé, lấy tên Tần Mục, ngậm đắng nuốt cay đem hắn nuôi lớn. Một ngày này màn đêm buông xuống, bóng tối bao trùm đại khư, Tần Mục đi ra cửa chính. . .\r\n\r\nLàm gió xuân bên trong nhộn nhạo nhân vật phản diện đi!\r\n\r\nNgười mù nói với hắn.\r\n\r\nTần Mục nhân vật phản diện chi lộ, ngay tại quật khởi!', 0, 10, 1, '2018-09-13 09:29:52', NULL, 0, 0, 0, '2018-09-13 09:29:52', 2);
